def safe_convert(x, dtype=float):
    try:
        return dtype(x)
    except:
        return None

df["price_per_night"] = df["price"].apply(lambda x:safe_convert(x.replace("$","")))
df["capacity"] = df["person_capacity"].apply(lambda x:safe_convert(x, int))
df["satisfaction"] = df["satisfaction_guest"].apply(lambda x:safe_convert(x, int))
df["cleanliness"] = df["rating_cleanliness"].apply(lambda x:safe_convert(x, int))
df["communication"] = df["rating_communication"].apply(lambda x:safe_convert(x, int))
df["instant"] = df["instant_book"].apply(lambda x: 1 if x == "True" else 0)
